(function(dust){dust.register("wallet\/inc\/padTerms",body_0);function body_0(chk,ctx){return chk.w("<div><p class=\"pad_termsConditions\"><b>Contracting Party and Subject-Matter of the Contract.</b>This agreement is a contract between you and PayPal (Europe) S.à r.l. et Cie, S.C.A., which supplements the PayPal User Agreement and specifically governs your use of \"Pay After Delivery\".</p><p class=\"pad_termsConditions\"><b>How \"Pay After Delivery\" works.</b>When you do a payment with \"Pay After Delivery\", recipients will receive the transaction amount immediately in their PayPal account. The transaction amount will be debited from your bank account via Direct Debit no sooner than at least 14 days from the date of the transaction.</p><p class=\"pad_termsConditions\"><b>Direct Debit as funding source.</b>In order to use \"Pay After Delivery\", you must have a valid bank account on file, which has been added to your PayPal account, and identified it as your primary bank account or preferred funding source from. \"Pay After Delivery\" may not be used with other funding sources such as, for example, a credit card. The entire transaction amount will be funded from the primary bank account linked to your PayPal account, even if you have a balance in your PayPal account.</p><p class=\"pad_termsConditions\">For each payment using \"Pay After Delivery\", you authorise PayPal to debit the primary bank account for the full payment amount no sooner than at least 14 days after the transaction date. The date, on which your bank account will be debited, is going to be displayed in your PayPal account statement and in an email which is sent to you.</p><p class=\"pad_termsConditions\">You select \"Pay After Delivery\" for a payment, the entire transaction amount will be funded via Direct Debit from your bank account, even if you have a balance in your PayPal account.</p><p class=\"pad_termsConditions\">If the initial debit is rejected or if insufficient funds are available, you authorise PayPal to resubmit the instruction for a Direct Debit. If the second debit fails as well, PayPal may use one of the other existing funding sources to obtain the transaction amount. The hierarchy of funding sources as defined in section 3.4 of the PayPal user agreement applies.</p><p class=\"pad_termsConditions\"><b>Eligibility.</b>PayPal may decide whether you may use \"Pay After Delivery\". Eligibility criteria include but are not limited to transaction activity. Moreover, only consumers may use \"Pay After Delivery\". \"Pay After Delivery\" is not available for commercial use.</p><p class=\"pad_termsConditions\"><b>Choice.</b>You may change your preferred funding source for each individual transaction. That means that you may decide each time whether you want to use \"Pay After Delivery\" or another available funding source such as a credit card, balance or Direct Debit without the functionality \"Pay After Delivery\".</p><p class=\"pad_termsConditions\"><b>Suspension and Termination of \"Pay After Delivery\" by PayPal.</b>PayPal has the right, at any time, to terminate, cancel, suspend or modify \"Pay After Delivery\", qualifications or eligibility for \"Pay After Delivery\", or your ability to use \"Pay After Delivery\". Transaction which you have already initiated will still be performed.</p><p class=\"pad_termsConditions\"><b>Customer Verification.</b>You can use \"Pay After Delivery\" for purchases up to EUR 15,000 and above. However, once you have made purchases totalling EUR 15,000 or more, you will be asked to confirm some information about your identity. Upon successful completion of the identity check you can continue using \"Pay After Delivery\".</p><p class=\"pad_termsConditions\"><b>Definitions.</b>Terms not otherwise defined in this agreement shall have the meaning set forth in the PayPal User Agreement.</p></div>");}body_0.__dustBody=!0;return body_0;})(dust);
(function(dust){dust.register("wallet\/inc\/viewOurPolicy",body_0);function body_0(chk,ctx){return chk.w("<p>PayPal allows you to make payments using a variety of methods including: PayPal Balance, bank account, credit card, PayPal Credit and debit card. Because your protection against undelivered or defective goods will vary with each method, you should review this page to understand how you can select a payment method and how protection differs depending on your funding source.</p> <p>This page does not address unauthorised transactions. For information on your protection against unauthorised transactions, please see section 12 of the PayPal User Agreement.</p><h4>Default Funding Sources <sup>*</sup></h4><p>When you make a payment, if you have not selected a preferred funding source, PayPal will fund your transaction in this order:</p> <ul> <li>PayPal Balance</li> <li>Instant transfer from your bank account (if eligible)</li> <li>PayPal Credit (PayPal Credit, PayPal Extras Card or PayPal Smart Connect)</li> <li>Debit card</li> <li>Credit card</li> <li>eCheque (a delayed transfer from your bank account – may result in significantly slower dispatch by seller) </li> </ul> <p><sup>*</sup> Note: If you do not want to use your Balance, you can withdraw it before making a payment.</p> <h4>Preferred Funding Source</h4> <p>You may select a preferred funding source each time you make a payment, except when making a Pre-approved Payment, a No Login Payment, or an Instore Checkout Payment. Certain funding sources may not be available for certain transactions if there are funding source limitations, including if you make a PayPal payment through certain third-party websites or applications, or if you use PayPal for Instore Checkout. For a Pre-approved Payment or, in most instances, a No Login Payment, you can select a preferred funding source when you provide your initial authorisation for this payment and through the My Pre-approved Payments section of your Account Profile (it may be called \"Backup funding source\"). For Instore Checkout payments, you may change your preferred funding source in your Account Profile prior to initiating your transaction.</p><p>If you select a preferred funding source but have available balance in your account, your balance will be used to fund your payment first. If you set a PayPal Credit product or eCheque as your preferred funding source in your account profile, it will be used to fund your PayPal payments first, even if you have a balance. eCheque is not an available funding source for Instore Checkout.</p><p>For business payments, you are limited to funding your PayPal payment with either (or both) your Balance or by eCheque.</p><h4>Changing the funding source</h4><p>You may change the funding source at the time you make a payment by clicking the 'More Options'/'Change' link on the Confirm Your Payment/Review Your Information page and then selecting a funding source on the \"More Funding Options\" page. You may do this each time you make a payment if you do not have a Balance. If you have a balance, you must use your entire balance before you can change the funding source.</p><p>You cannot select a funding source for all future transactions, except that if you have been approved for PayPal Credit and PayPal Credit is an available funding source for the transaction, you may select PayPal Credit as your preferred funding source. You may do so by logging in to your account, selecting \"Profile\", selecting your PayPal Credit product and then setting it as your preferred funding source.</p><h4>Funding Source Rights and Remedies</h4><h5>PayPal Buyer Protection</h5><p>PayPal Buyer Protection applies for certain qualifying purchases regardless of the funding source. For these qualifying purchases, PayPal will cover you for the full amount of the item plus original delivery costs if you do not receive the item or if you receive an item but it is significantly different from the description the seller provided. To receive reimbursement for items that are significantly not as described, you will be required to return the item to the seller, or in some cases to PayPal and to pay the return delivery costs. PayPal Buyer Protection is not available for Instore Checkout transactions.</p><p>To be eligible for PayPal Buyer Protection, you must open a dispute in the PayPal Resolution Centre within 45 days of the date you sent the payment, escalate the dispute to a claim within 20 days of the date you opened the dispute, and meet the eligibility criteria in Section 13 of the PayPal User Agreement.</p><h5>PayPal Credit Protection</h5><p>PayPal Credit offers protection against unauthorised transactions and billing errors, including items not received and items received that are significantly not as described. If any of these issues occur, you must open a dispute with PayPal Credit within 60 days of the date of your first bill on which the issue occurred. You may open a dispute by either of these methods:</p><ul class=\"nostyle\"><li>(1) Dispute Form: Complete the form at <a href=\"www.billmelater.com/Docs/disputeform.pdf\">Dispute Form</a> and mail or fax it to: </li><li class=\"lifloat\"><ul class=\"spacing\"><li>PayPal Credit</li><li>PO Box 5018</li><li>Timonium, MD 21094</li><li>Fax: 443-921-1996</li></ul></li></ul><ul class=\"nostyle\"><li class=\"lipadding\">(2) By Letter: Send a letter to the address above and include the following information: <p class=\"billph\">Your name and account number</p><p>The dollar amount pertaining to the error / transaction with the issue</p><p>A description of the error / transaction with the issue, and an explanation</p></li></ul><p>To learn more about BML protections, please see your PayPal Credit Terms and Conditions.</p><p>You may pursue a Dispute/Claim with PayPal, or you may contact PayPal Credit and open a dispute. You may not pursue both at the same time or seek a double recovery. If you have an open Dispute or Claim with PayPal, and also open a dispute with PayPal Credit, PayPal will close your Dispute or Claim, and you will have to rely solely on your rights under your dispute with PayPal Credit.</p><p>If you pursue a Claim with PayPal and you do not receive a full recovery, you can then open a dispute with PayPal Credit. If PayPal does not make a final decision on your Claim until after PayPal Credit's deadline for opening a dispute, and because of our delay you recover less than the full amount you would have been entitled to recover from the PayPal Credit, PayPal will reimburse you for the remainder of your loss (minus any amount you have already recovered from the seller.</p><h5>Credit Card Protection</h5><p>Credit card chargeback rights are broader than PayPal's protection programmes. Credit card chargebacks may be filed more than 45 days after the payment and may cover unsatisfactory items even if they do not qualify as significantly not as described. </p><p>You may pursue a Dispute/Claim with PayPal, or you may contact your credit card company and file a chargeback. You may not pursue both at the same time or seek a double recovery. If you have an open Dispute or Claim with PayPal, and also file a chargeback with your credit card company, PayPal will close your Dispute or Claim, and you will have to rely solely on your chargeback rights.</p><p>If you pursue a Claim with PayPal and if you do not receive a full recovery, you can then file a chargeback. If PayPal does not make a final decision on your Claim until after your credit card issuer's deadline for filing a chargeback, and because of our delay you recover less than the full amount you would have been entitled to recover from the credit card issuer, we will reimburse you for the remainder of your loss (minus any amount you have already recovered from the seller).</p><p>Credit card companies must abide by these statutory guidelines, including but not limited to the following:</p><ul><li>If a consumer claims a \"billing error\" because an item is not received or is refused at the time of delivery, the card issuer is obliged to investigate, resolve, and to correct written claims filed by the consumer within 60 days of receipt of the applicable credit card statement.</li><li>If a consumer claims a dispute with a merchant, the card issuer is obliged to investigate and resolve consumer claims, provided the consumer: (i) has not paid for the charge (ii) has made a good faith attempt to settle the dispute with the merchant (iii) lives in the same state as or within 100 miles of the merchant and (iv) paid more than $50 for the item. </li></ul><p>You should contact your credit card issuer to learn more about your rights and remedies.</p><h5>Debit Card Protection</h5><p>Your debit card issuer is not required by law to provide you with protection against items that you do not receive or that are significantly not as described. Many debit card issuers voluntarily provide protection similar to the chargeback rights provided by credit card issuers. </p><p>PayPal may process debit card transactions through either (a) an ATM debit network such as STAR or NYCE, or (b) a Visa or MasterCard network. If we process your debit card through an ATM debit network, we may provide you with the opportunity to switch to a Visa or MasterCard network by clicking the \"Funding Sources\" link on the payment confirmation page. Choosing the Visa / MasterCard network may give you additional protection compared to the ATM debit networks. You should contact your debit card issuer to learn more about your rights and remedies if you pay with your debit card.</p><h5>Bank Account Protection</h5><p>Your bank is not required by law to provide you with protection against items that you pay for with a bank transfer but that you do not receive or that are significantly not as described. You should contact your bank to determine if they voluntarily provide any buyer protection.</p>");}body_0.__dustBody=!0;return body_0;})(dust);
