(function(dust){dust.register("wallet\/overpanel\/bank\/termsAndCondition_BR",body_0);function body_0(chk,ctx){return chk.w("<p>These Use Terms (\"Use Terms\") sets out the terms of the Direct Debit arrangements between you and PayPal do Brasil Serviços de Pagamentos Ltda. to enable you to send payments with your PayPal account using the Bank Account.</p> <p>In these Use Terms these words have the following meanings:</p> <p>\"PayPal\" means PayPal do Brasil Serviços de Pagamentos Ltda.;</p> <p>\"You\" or \"I\" means the Bank Account holder;</p> <p>\"PayPal Account\" means the account that You hold with PayPal, through which PayPal provides You with payment services; and</p> <p>\"Bank Account\" means the bank account You indicated as a funding source in your PayPal Account, by means of a Direct Debit.</p> <p>TERMS AND CONDITIONS</p> <p>1. You warrant and guarantee that you are the person that can authorise withdrawals from the Bank Account.</p> <p>2. You can cancel your Direct Debit authorisation for future transactions at any time by removing the Bank Account from the PayPal system through the \"Profile\" tab available after logging in at the PayPal website. However, you acknowledge that removing the Bank Account from the PayPal system does not cancel pending transactions that you have already initiated and authorised.</p> <p>3. You acknowledge that revocation of the Direct Debit authorisation does not terminate any contract for services that exists between PayPal and you. The authorisation applies only to the method of payment and does not otherwise have any bearing on the contract for services exchanged.</p> <p>4. It is your responsibility to ensure that you have sufficient funds in the Bank Account to enable drawings to be made in accordance with the Agreement.</p> <p>4.1. If there are insufficient funds in the Bank Account to enable a drawing to be made, this may result in the drawing being reversed. In these circumstances you may be charged a fee and/or interest by your financial institution.</p> <p>4.2. If there are insufficient funds in the Bank Account to enable a drawing to be made or if you do not approve a requested drawing, we may charge the amount to a backup funding source that may be either a credit card or another bank account.</p> <p>5. A Direct Debit is not available on all bank accounts. You should check with your financial institution to ensure that the Bank Account can accept Direct Debits.</p> <p>6. If any drawing of funds from the Bank Account falls due on a non-working day in the place where the Bank Account is held, it will be debited to the Bank Account on the next working day following the drawing date.</p> <p>7. Please direct any enquiries you have to Customer Service online through the PayPal Help Centre at any time, or by calling 0800 892 1555 from 9.00am to 6.00pm, from Monday to Saturday. All communication addressed to us should include your name and address, account name and contact phone number.</p> <p>8. All personal customer information held by PayPal will be kept confidential except the information provided to the financial institution involved to initiate the drawing to the Bank Account. We may also disclose the information to the relevant financial institutions in the event of a claim or an alleged incorrect or wrongful debit, or as otherwise requested by law.</p> <p>9. During the term of this Agreement the Bank Account will be debited by PayPal.</p>");}body_0.__dustBody=!0;return body_0;})(dust);
