(function(dust){dust.register("wallet\/overpanel\/padTermsAndCondition",body_0);function body_0(chk,ctx){return chk.w("<p><p>1. This Pay After Delivery (PAD) Facility Agreement is a contract between You and PayPal (Europe) S.à r.l. et Cie, S.C.A., which supplements the PayPal User Agreement and specifically governs your use of the PAD facility. You agree that any use by You of the PAD facility shall constitute your acceptance of this PAD Facility Agreement. We recommend You save or print a copy of this Agreement for your records.      </p><p>2. Capitalised terms not otherwise defined in this PAD Facility Agreement shall have the meaning set forth in the PayPal User Agreement.</p><p>3. The PAD Facility allows You to fund your PayPal Account without having to pre-fund it.</p><p>4. When using the PAD Facility, PayPal will not charge You any fees or interest and the total amount outstanding will be repaid by You no sooner than at least 14 days from the date of the transaction.</p><p>5. You can use the PAD payment option for purchases up to £12,500 and above. However, once you have made purchases totalling £12,500 or more, You will be asked to confirm some information about your identity. In order to be able to keep using the PAD facility, You will be required to complete the information we ask for.      </p><p>6. You can change your checkout settings or unsubscribe from the PAD Facility at any time on your PayPal Profile page.</p><p>7. PayPal will determine at its sole discretion whether You are eligible for the PAD Facility. Eligibility criteria include but are not limited to transaction activity and a valid payment method. Only eligible PayPal account holders will be able to sign up to the PAD Facility.       </p><p>8. Your PAD Facility is only for consumer use and it is not intended to be for business or commercial use. Your PAD Facility transactions will appear in the Transaction History of your Account Overview, separate from your PayPal account transactions, until PayPal has settled your PAD Facility.     </p><p>9. The Pay After Delivery (PAD) payment option or PAD facility allows qualifying Users to purchase eligible items and wait up to 14 days or longer to pay for them. The PAD payment option is only available for eligible purchases made under the existing PayPal User Agreement and is not available to all Users. In order to use PAD, qualifying Users must have a valid bank account on file, which has been added to their PayPal account, and identified as their primary bank account or preferred funding source from which funding transfers may be withdrawn. If a valid bank account hasn't been added as a preferred funding source then PAD will not be available, even if You have used PAD before.      </p><p>10. Where You and the item purchased are eligible for PAD, which shall be determined at PayPal's sole discretion, you may choose the PAD payment option at the time of purchase. Although PayPal will not impose a fee for your use of PAD, it is possible a third party, such as the financial institution holding the primary bank account, may impose a fee in connection with the payment or purchase, in addition to the amount of the transaction.      </p><p>11. If You select PAD as the payment method, the entire transaction amount will be funded from the primary bank account linked to your PayPal account, even if You have a balance in this PayPal account, except where there are insufficient available funds in the primary bank account. You authorise PayPal to submit an instruction to debit from your primary bank account the amount of the transaction, and to re-submit this instruction if the initial debit is rejected or if insufficient funds are available.      </p><p>12. The hierarchy of payment methods as defined in the PayPal User Agreement will apply in the event that your preferred funding source is declined. For each payment using PAD, You authorise PayPal to debit the primary bank account for the full payment amount 14 days after the transaction date, or sooner in accordance with your instructions. The date of the debit may be longer than 14 days after the transaction date due to bank processing times. PayPal will send you a reminder by email before the scheduled amount is debited. </p><p>13. Where You have qualified for and initiated a PAD transaction, PAD will be identified as your preferred funding source for future eligible transactions. However, You may change your preferred payment method at any time for future transactions. You will still need to select the PAD payment option for each qualifying payment at the time of the transaction. You may select a different payment method for future transactions and change your payment method at the time You make the payment.      </p><p>14. PayPal Buyer Protection rights described in Section 13 of the User Agreement will apply to a purchase using a PAD payment option. If You have a problem with a purchase you must follow the procedures described in Section 13 of the PayPal User Agreement and open a dispute within 180 days from the date You made the purchase. If You open a dispute with PayPal within 14 days of making the purchase with PAD, PayPal will only debit the primary bank account once the resolution process has been completed and if we find in the seller's favour. You authorise PayPal to debit your primary bank account for the full payment amount if we find in the seller's favour.      </p><p>15. PayPal has the right, at any time and at its sole discretion, to terminate, cancel, suspend or modify the PAD payment option, qualifications or eligibility for PAD, or your ability to use PAD.</p></p>");}body_0.__dustBody=!0;return body_0;})(dust);
